import React from 'react'
// import Button from '@material-ui/core/Button';
import { ButtonGroup,Button } from '@material-ui/core';

const Materialui = () => {

    return (
        <>

            <ButtonGroup color="primary" >
                <Button>One</Button>
                <Button>Two</Button>
                <Button>Three</Button>
            </ButtonGroup>




        </>
    )
}

export default Materialui
